class Solution(object):    def canJump(self, nums):        """        :type nums: List[int]        :rtype: bool        """        if len(nums)==1:            return True        number=0        i=0        while i<=number and number<len(nums):            number=max(i+nums[i],number)            i+=1        if number >= len(nums)-1:            return True        else:            return Falsenums=[2,0,0]s=Solution()print(s.canJump(nums))